import React from 'react';
import './App.css';
import {Switch, Route} from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import Home from "./pages/home/home";

function App() {
  return (
    <Switch>
      <Route path="/" component={Home} exact />
      <Route component={Error} />
    </Switch>
  )
}

export default App;
